                Vue.set(_this.companionEntries[index], 'last_name_latin', companionEntry.last_name_latin ? companionEntry.last_name_latin.replace('　', '').trim() : '');
                Vue.set(_this.companionEntries[index], 'first_name_latin', companionEntry.first_name_latin ? companionEntry.first_name_latin.replace('　', '').trim() : '');
