window._PageEntry_Confirm = {
    /**
     * プロパティ群
     */
    props: {
        // 回答情報
        entry: {
            type: Object,
            required: true,
        },
        // お連れ様の回答情報
        companionEntries: {
            type: Array,
            required: true,
        },
        // 決済可能状態
        isPayable: {
            type: Boolean,
            required: true,
        },
        // 上位のエラー情報
        parentErrors: {
            required: true,
        },
    },
    /**
     * データ群
     */
    data: function () {
        return {
            // 欠席でも決済を行うか否か
            isAbsentPayment: false,
        }
    },
    /**
     * ウォッチャ
     */
    watch: {
        // 上位のエラー情報
        parentErrors: function (newValue) {
            var _this = this;
            if (newValue.length > 0) {
                // VueのDOM更新は非同期のため、DOMの更新が全て終わってからUI処理を行う
                Vue.nextTick(function () {
                    var $elem = $(_this.$el).find('.js-alert-wrapper').first();
                    if ($elem.is(':visible')) {
                        $('html, body').animate({scrollTop: ($elem.offset().top - 10)}, 1000);
                    }
                });
            }
        },
    },
    /**
     * 算出プロパティ
     */
    computed: {
        // 事前支払い画面を見せるか否か
        showableCredit: function () {
            var showCredit = false;
            if (this.entry.entry === 'ご出席') {
                showCredit = true;
            }
            // 欠席でも決済を行う場合は強制ON
            if (this.isAbsentPayment) {
                showCredit = true;
            }
            // オンライン出席は決済画面表示
            if (this.entry.entry === 'オンライン出席') {
                showCredit = true;
            }
            // 決済可能状態で、支払い画面を見せる場合にtrue
            return this.isPayable && showCredit;
        }
    },
    /**
     * インスタンス生成時に実行される処理
     */
    created: function () {
        // 欠席でも決済を行うか否かをHTMLから取得
        this.isAbsentPayment = document.querySelector('[data-role="absent_payment"]').innerHTML === 'true';
    },
    /**
     * 各種メソッド
     */
    methods: {
        /**
         * ゲスト区分の文字列
         */
        guestTypeLabel: function () {
            var label = '';
            if (this.entry.guest_type) {
                if (Number(this.entry.guest_type) === 1) {
                    label = '新郎ゲスト';
                }
                if (Number(this.entry.guest_type) === 2) {
                    label = '新婦ゲスト';
                }
            }
            return label;
        },
    }
};

/**
 * 招待状回答フォーム決済画面用のVueコンポーネント
 */
window._PageEntry_Credit = {
    /**
     * ミックスインオブジェクト
     */
    mixins: [
        _CommonMixin,
    ],
    /**
     * プロパティ群
     */
    props: {
        // 回答情報
        entry: {
            type: Object,
            required: true,
        },
        // 上位のエラー情報
        parentErrors: {
            required: true,
        },
        // チケット情報
        tickets: {
            required: true,
        },
    },
    /**
     * データ群
     */
    data: function () {
        return {
            // ご祝儀決済か否か
            isGosyugiPayment: false,
            // クレジットカードの利用有無
            useCreditCard: null,
            // ご祝儀の金額が手動入力か否か
            gosyugiManualInput: false,
            // 合計金額
            amount: 0,

            // エラー情報
            errors: {},
        }
    },
    /**
     * ウォッチャ
     */
    watch: {
        // クレジットカードの利用有無
        useCreditCard: function (newValue) {
            if (newValue === '1') {
                $(this.$el).find('.js-credit-card-area').slideDown();
            } else {
                $(this.$el).find('.js-credit-card-area').slideUp();
            }
        },
        // 上位のエラー情報
        parentErrors: function (newValue) {
            var _this = this;
            if (newValue.length > 0) {
                // VueのDOM更新は非同期のため、DOMの更新が全て終わってからUI処理を行う
                Vue.nextTick(function () {
                    var $elem = $(_this.$el).find('.js-alert-wrapper').first();
                    if ($elem.is(':visible')) {
                        $('html, body').animate({scrollTop: ($elem.offset().top - 10)}, 1000);
                    }
                });
            }
        },
        // チケット情報が更新されたら合計金額も変更
        tickets: function () {
            this.calcAmount();
        },
    },
    /**
     * 算出プロパティ
     */
    computed: {
        // ご祝儀のクレジット画面にするか否か
        isShowGosyugi: function () {
            // 欠席で決済を行う場合は固定でご祝儀のUI
            if (this.entry.entry === 'ご欠席') {
                return true;
            }
            // 出席の場合は、ご祝儀決済か否かでUI分け
            return this.isGosyugiPayment;
        }
    },
    /**
     * インスタンス生成時に実行される処理
     */
    created: function () {
        // ご祝儀決済か否かをHTMLから取得
        this.isGosyugiPayment = document.querySelector('[data-role="is_gosyugi_payment"]').innerHTML === 'true';
    },
    /**
     * 画面描画後に呼び出される処理
     */
    mounted: function () {
        // tooptipを有効に
        var trigger = this.$el.querySelector('#tooltip_security_code_trigger');
        var content = this.$el.querySelector('#tooltip_security_code_content');
        tippy(trigger, {content: content.innerHTML});

        // GMOペイメント初期化
        Multipayment.init(document.querySelector('[data-role="gmo_pay_key"]').innerHTML);
        this.calcAmount();
    },
    /**
     * 各種メソッド
     */
    methods: {
        /**
         * ご祝儀の金額ドロップダウンが変更された際に呼ばれる処理
         * @param e
         */
        gosyugiDropdownChanged: function (e) {
            var dropdown = e.currentTarget;
            var options = dropdown.options;
            var selectedOption = options[dropdown.selectedIndex];

            // その他の金額を入力の場合は手動入力に切り替え
            this.gosyugiManualInput = selectedOption.value === 'other';
        },
        /**
         * 会費決済の合計金額を計算する
         */
        calcAmount: function () {
            var amount = 0;
            this.tickets.forEach(function(ticket) {
                amount = amount + (ticket.price * ticket.count);
            });
            this.amount = amount;
        },
        /**
         * ご祝儀の金額を計算する
         */
        calcGosyugiAmount: function () {
            var amount = 0;
            if (this.gosyugiManualInput) {
                // 手動入力の場合
                amount = this.$el.querySelector('input[name="gosyugi_manual_input"]').value;
            } else {
                // ドロップダウン選択の場合
                var dropdown = this.$el.querySelector('select[name="gosyugi_dropdown"]');
                var options = dropdown.options;
                var selectedOption = options[dropdown.selectedIndex];
                amount = selectedOption.value;
            }
            // inputにバインド
            this.$el.querySelector('input[name="gosyugi_amount"]').value = amount;
            this.amount = amount;
        },

        /**
         * 確定処理
         */
        submit: function () {
            var _this = this;
            if (_this.isShowGosyugi) {
                _this.calcGosyugiAmount();
            }
            // VueのDOM更新は非同期のため、DOMの更新が全て終わってから処理を行う
            Vue.nextTick(function () {
                if (_this.validate()) {
                    if (_this.useCreditCard === '1') {
                        vex.dialog.confirm({
                            message: 'クレジットカードで' + _this.$_numberFormat(_this.amount) + '円を事前支払いします。よろしいですか？',
                            callback: function (value) {
                                if (value === true) {
                                    _this.$_loading();
                                    _this.submitGmoPay();
                                }
                            }
                        });
                    } else {
                        // 当日払い
                        _this.submitByCash();
                    }
                }
            });
        },
        /**
         * 当日払い処理
         */
        submitByCash: function () {
            // 当日支払いの場合はエントリー確定処理
            // トークン情報はフォームから削除
            this.$el.querySelector('[name="gmo_pay_token"]').value = null;
            this.$el.querySelector('[name="card_no"]').value = null;
            this.$el.querySelector('[name="security_code"]').value = null;
            this.$emit('credit-submitted');
        },

        /**
         * GMOペイメントでトークン取得処理を行う
         */
        submitGmoPay: function () {
            Multipayment.getToken({
                cardno: this.$el.querySelector('[name="card_no"]').value,
                expire: this.$el.querySelector('[name="expire_year"]').value + this.$el.querySelector('[name="expire_month"]').value,
                securitycode: this.$el.querySelector('[name="security_code"]').value,
            }, _GmoPayCallback);
        },

        /**
         * 親要素に決済完了を通知
         */
        emitCreditSubmit: function () {
            this.$emit('credit-submitted');
        },

        /**
         * 親要素にエラーを通知
         * @param errors
         */
        emitParentErrors: function (errors) {
            this.$emit('update:parentErrors', errors);
        },

        /**
         * バリデーションを行う
         */
        validate: function () {
            this.errors = {};
            var errorElem = '';

            // 支払い方法の選択
            if (this.useCreditCard !== '1' && this.useCreditCard !== '0') {
                this.errors.not_selected = true;
                errorElem = errorElem || '#credit_select';
            }

            if (this.useCreditCard === '1') {
                if (this.isShowGosyugi) {
                    // ご祝儀決済の場合

                    // ご祝儀金額
                    var gosyugiAmount = this.$el.querySelector('input[name="gosyugi_amount"]').value;
                    if (validator.isBlank(gosyugiAmount)) {
                        this.errors.not_input_gosyugi = true;
                        errorElem = errorElem || '#gosyugi_form';
                    } else if (!validator.isInt(gosyugiAmount, {min: 1000, max: 200000})) {
                        this.errors.invalid_gosyugi = true;
                        errorElem = errorElem || '#gosyugi_form';
                    }

                } else {
                    // 会費決済の場合

                    // チケットの選択
                    var ticket_selected = false;
                    this.tickets.forEach(function(ticket) {
                        if (ticket.count > 0) {
                            ticket_selected = true;
                        }
                    });
                    if (!ticket_selected) {
                        this.errors.not_select_ticket = true;
                        errorElem = errorElem || '#credit_ticket';
                    }
                }
                // カード番号
                var cardNo = this.$el.querySelector('input[name="card_no"]').value;
                if (validator.isBlank(cardNo) || !validator.isNumeric(cardNo)) {
                    this.errors.card_no = true;
                    errorElem = errorElem || '#credit_card_no';
                }
            }

            var valid = Object.keys(this.errors).length === 0;

            // エラー時はエラー箇所までスムーススクロール
            if (!valid && !!errorElem) {
                // VueのDOM更新は非同期のため、DOMの更新が全て終わってからUI処理を行う
                Vue.nextTick(function () {
                    $('html, body').animate({scrollTop: $(errorElem).offset().top}, 1000);
                });
            }

            return valid;
        },
    }
};

